class CreateUniversity
  attr_accessor :new_cities, :ask_cities, :found_cities
  def initialize
    @new_cities = []
    @ask_cities = []
    @found_cities = []
  end
  
  def add(params)
    univ_name = params[:name].titleize
    city_name, state_abbr = params[:city].titleize, params[:state].humanize
  	city = City.by_name(city_name).state_abbr(state_abbr).first
  	if city.nil?
  		state = State.find_by_abbr(state_abbr)
      cities = City.find_all_by_name(city_name)
      if cities.length == 0
        City.create(:name => "#{city_name}", :state_id => state.id)
      end
  	end
    University.create(:name => univ_name, :city_name => city_name, :state_abbr => state_abbr, :enrollment => params[:enrollment], :tuition => params[:tuition])
  end
end

